    return new pJb(nJb(new oJb, '<div class="expertPopupRow dewaele"><div class="expertPopupRowPicture"/><\/div><div class="expertPopupRowRight"><h2>Bruno DEWAELE<\/h2><h3>Champion du monde d\u2019orthographe<\/h3><p>Champion du monde d\u2019orthographe (titre d\xE9livr\xE9 \xE0 l\u2019ONU \xE0 l\u2019occasion du fameux concours rassemblant 108 pays), professeur agr\xE9g\xE9 de lettres modernes au Lyc\xE9e des Flandres d\u2019Hazebrouck, chroniqueur de langue \xE0 La Voix du Nord, blogueur prolixe sur les sites <i>\xC0 la fortune du mot<\/i> et <i>Par mots et par vaux<\/i> ; a publi\xE9 plusieurs ouvrages, dont <i>Comme sur des roulottes !<\/i> qui a re\xE7u le Prix de l\u2019Acad\xE9mie des Treize en 1984 et Les All\xE9es d\u2019\xC9tigny qui a re\xE7u en 1992 la M\xE9daille d\u2019or de l\u2019Acad\xE9mie des lettres, sciences et arts d\u2019Arras ainsi que le Prix de la nouvelle de la Renaissance fran\xE7aise du Nord-Pas-de-Calais.<\/p><\/div><\/div><div class="expertPopupRow claerebout"><div class="expertPopupRowPicture"/><\/div><div class="expertPopupRowRight"><h2>Marie-France CLAEREBOUT<\/h2><h3>R\xE9dactrice-correctrice<\/h3><p>Titulaire d\u2019un DEA en th\xE9orie des langages et d\u2019un mast\xE8re en sciences de l\u2019information, elle a quitt\xE9 depuis quelques ann\xE9es le monde de l\u2019entreprise pour se consacrer \xE0 sa passion : la langue fran\xE7aise. Elle intervient aujourd\u2019hui aupr\xE8s de la presse \xE9crite en qualit\xE9 de secr\xE9taire de r\xE9daction, et assure la pr\xE9paration d\u2019ouvrages de r\xE9f\xE9rence pour d\u2019importantes maisons d\u2019\xE9dition. Son int\xE9r\xEAt pour l\u2019enseignement l\u2019am\xE8ne par ailleurs \xE0 r\xE9diger des supports p\xE9dagogiques et \xE0 animer r\xE9guli\xE8rement des formations dans le domaine de l\u2019orthographe.<\/p><\/div><\/div><div class="expertPopupRow campese"><div class="expertPopupRowPicture"/><\/div><div class="expertPopupRowRight"><h2>Sandrine CAMPESE<\/h2><h3>Auteure et r\xE9dactrice ind\xE9pendante<\/h3><p>Auteure, r\xE9dactrice ind\xE9pendante, Sandrine Campese est sp\xE9cialiste de la langue fran\xE7aise. En 2011, elle cr\xE9e son blog <i>La plume \xE0 poil<\/i> o\xF9 elle \xAB d\xE9shabille les mots \xBB. Depuis 2014, elle collabore au Projet Voltaire en tant que contributrice et animatrice. Elle a publi\xE9 plusieurs livres aux \xC9ditions de l\u2019Opportun : <i>99 dessins pour ne plus faire de fautes<\/i>, <i>99 nouveaux dessins pour ne plus faire de fautes<\/i>, et <i>Z\xE9ro faute gr\xE2ce au cin\xE9ma<\/i>.<\/p><\/div><\/div><div class="expertPopupRow soulie"><div class="expertPopupRowPicture"/><\/div><div class="expertPopupRowRight"><h2>Julien SOULI\xC9<\/h2><h3>Professeur de fran\xE7ais<\/h3><p>Membre du comit\xE9 d\u2019experts et formateur pour le Projet Voltaire, Julien Souli\xE9 a \xE9t\xE9 professeur de lettres classiques. Passionn\xE9 d\u2019orthographe, de grammaire et d\u2019\xE9tymologie, il a remport\xE9 les \xAB Timbr\xE9s de l\u2019orthographe \xBB en 2013. Verbicruciste, notamment pour la revue 7 \xC9toiles, il r\xE9dige aussi des dict\xE9es pour des concours d\u2019orthographe. Il est l\u2019auteur de nombreux livres sur la langue fran\xE7aise, Il est l\u2019auteur de nombreux livres sur la langue fran\xE7aise, parmi lesquels <i>Exercices d\u2019orthographe pour les nuls<\/i>, <i>Kit de secours pour les nuls en orthographe<\/i>, <i>Trucs et astuces pour \xE9crire sans fautes<\/i>, <i>Le fran\xE7ais, c\u2019est facile !<\/i> (\xE9d. First), ainsi que <i>L\u2019Officiel du Certificat Voltaire<\/i> (\xE9d. L\u2019\xC9tudiant).<\/p><\/div><\/div><div class="expertPopupRow derancourt"><div class="expertPopupRowPicture"/><\/div><div class="expertPopupRowRight"><h2>J\xE9r\xF4me DERANCOURT<\/h2><h3>Professeur de math\xE9matiques<\/h3><p>Professeur de math\xE9matiques en lyc\xE9e et en \xE9cole d\u2019ing\xE9nieur(e)s, \xE9galement professeur de sciences du num\xE9rique et technologie, J\xE9r\xF4me Derancourt a toujours \xE9t\xE9 passionn\xE9 par l\u2019am\xE9lioration des pratiques p\xE9dagogiques. C\u2019est cette passion qui l\u2019am\xE8ne \xE0 se pencher sur l\u2019\xE9valuation de l\u2019oral. Avec Pablo Martin-Pa\xF1eda, il invente une m\xE9thode d\u2019\xE9valuation in\xE9dite. La rencontre avec le Projet Voltaire leur permet d\u2019en faire un outil d\u2019entra\xEEnement et d\u2019\xE9valuation accessible \xE0 tous les enseignants qui souhaitent am\xE9liorer \xE0 la fois l\u2019\xE9coute, l\u2019esprit critique et l\u2019aisance \xE0 l\u2019oral de leurs \xE9l\xE8ves : \xAB Mon oral \xBB.<\/p><\/div><\/div><div class="expertPopupRow martin-paneda"><div class="expertPopupRowPicture"/><\/div><div class="expertPopupRowRight"><h2>Pablo MARTIN-PA\xD1EDA<\/h2><h3>Agr\xE9g\xE9 et docteur en histoire<\/h3><p>Agr\xE9g\xE9 et docteur en histoire, Pablo Martin-Pa\xF1eda s\u2019int\xE9resse aux discours et \xE0 leur impact sur le r\xE9el d\xE8s sa th\xE8se publi\xE9e par Paris-Sorbonne aux \xE9ditions PIE-Peter Lang en 2015. Pr\xE9paration des \xE9tudiants aux oraux d\u2019agr\xE9gation et de classes pr\xE9paratoires, oral en langue \xE9trang\xE8re, d\xE9bats entre lyc\xE9ens, ses exp\xE9riences l\u2019incitent \xE0 inventer avec J\xE9r\xF4me Derancourt une r\xE9ponse pratique pour l\u2019entra\xEEnement \xE0 l\u2019oral associ\xE9e \xE0 une m\xE9thode d\u2019\xE9valuation originale. Avec le Projet Voltaire, ils d\xE9cident d\u2019en faire un outil accessible \xE0 tous les enseignants pour faire progresser leurs \xE9l\xE8ves : \xAB Mon oral \xBB.<\/p><\/div><\/div><div class="expertPopupRow roquetaniere"><div class="expertPopupRowPicture"/><\/div><div class="expertPopupRowRight"><h2>Estelle ROQUETANI\xC8RE<\/h2><h3>Lectrice-correctrice et r\xE9dactrice<\/h3><p>Estelle Roquetani\xE8re a travaill\xE9 pour plusieurs maisons d\u2019\xE9dition parisiennes publiant de la litt\xE9rature fran\xE7aise, de la litt\xE9rature \xE9trang\xE8re et de la litt\xE9rature jeunesse, et pour une maison d\u2019\xE9dition espagnole. Lectrice-correctrice \u2013 ou pr\xE9paratrice \u2013, elle effectue aujourd\u2019hui la lecture critique des manuscrits que lui confient les \xE9diteurs et revoit les textes avec les auteurs (litt\xE9rature fran\xE7aise et sciences humaines). Elle r\xE9vise \xE9galement les traductions et fait de la r\xE9\xE9criture. Elle est aussi r\xE9dactrice et formatrice pour le Projet Voltaire.<\/p><\/div><\/div><div class="expertPopupRow vernisse"><div class="expertPopupRowPicture"/><\/div><div class="expertPopupRowRight"><h2>\xC9velyne VERNISSE<\/h2><h3>Formatrice en communication \xE9crite<\/h3><p>Consultante, formatrice et coach en communication \xE9crite professionnelle et en ma\xEEtrise de la langue fran\xE7aise ; elle anime des formations collectives ou individuelles tant aupr\xE8s des entreprises, des \xE9tablissements scolaires sup\xE9rieurs que des particuliers. Elle d\xE9cline toujours le m\xEAme objectif : r\xE9diger avec aisance des courriels, des lettres, des comptes rendus efficaces et\u2026 sans fautes. Tr\xE8s \xE0 l\u2019\xE9coute, elle adapte ses formations selon le profil d\u2019apprentissage et con\xE7oit des ressources p\xE9dagogiques adapt\xE9es, en compl\xE9ment du Projet Voltaire.<\/p><\/div><\/div><div class="expertPopupRow colomb"><div class="expertPopupRowPicture"/><\/div><div class="expertPopupRowRight"><h2>Agn\xE8s COLOMB<\/h2><h3>Auteur-adaptateur<\/h3><p>Titulaire d\u2019un DEA de lettres modernes, Agn\xE8s Colomb est aujourd\u2019hui auteur-adaptateur aupr\xE8s de maisons d\u2019\xE9dition et d\u2019entreprises. Depuis dix ans, elle r\xE9crit et corrige des romans policiers et sentimentaux, traquant les fautes d\u2019orthographe et de grammaire sans rel\xE2che. Elle a \xE9galement collabor\xE9 \xE0 l\u2019\xE9criture de plusieurs romans, avant de signer Sur un air de tango, publi\xE9 chez J\u2019ai lu.<\/p><\/div><\/div>').a.a)
